import { useEffect, useState } from "react";
import { createFileRoute, useNavigate } from "@tanstack/react-router";
import { ArrowRight } from "lucide-react";

import { authClient } from "@/lib/auth-client";

export const Route = createFileRoute("/login")({
  component: LoginPage,
});

type AuthMode = "login" | "signup";

function LoginPage() {
  const session = authClient.useSession();
  const navigate = useNavigate();

  const [authMode, setAuthMode] = useState<AuthMode>("login");
  const [authState, setAuthState] = useState({
    email: "",
    password: "",
    loading: false,
    error: "",
    success: "",
  });

  useEffect(() => {
    if (session.isPending) return;
    if (session.data?.user) {
      navigate({ to: "/", replace: true });
    }
  }, [session.data?.user, session.isPending, navigate]);

  async function submitAuth(event: React.FormEvent<HTMLFormElement>) {
    event.preventDefault();
    setAuthState((state) => ({
      ...state,
      loading: true,
      error: "",
      success: "",
    }));

    try {
      if (authMode === "signup") {
        const { error } = await authClient.signUp.email({
          email: authState.email,
          password: authState.password,
          name: authState.email,
        });

        if (error) {
          console.error("Sign up error:", error);
          setAuthState((state) => ({
            ...state,
            error: error.message || "Something went wrong",
          }));
          return;
        }

        setAuthState((state) => ({
          ...state,
          success: "Account created.",
        }));
      } else {
        const { error } = await authClient.signIn.email({
          email: authState.email,
          password: authState.password,
        });

        if (error) {
          console.error("Sign in error:", error);
          setAuthState((state) => ({
            ...state,
            error: error.message || "Something went wrong",
          }));
          return;
        }

        setAuthState((state) => ({ ...state, success: "Welcome back." }));
      }
    } catch (error) {
      setAuthState((state) => ({
        ...state,
        error: error instanceof Error ? error.message : "Something went wrong",
      }));
    } finally {
      setAuthState((state) => ({ ...state, loading: false }));
    }
  }

  return (
    <div className="min-h-[calc(100vh-81px)]">
      {/* Form */}
      <div className="p-12 flex flex-col justify-center max-w-xl mx-auto w-full">
        <div className="mb-12 flex gap-8 text-sm uppercase font-bold tracking-widest">
          <button
            onClick={() => setAuthMode("login")}
            className={`pb-2 border-b-2 transition-colors ${authMode === "login" ? "border-foreground text-foreground" : "border-transparent text-muted-foreground"}`}
          >
            Login
          </button>
          <button
            onClick={() => setAuthMode("signup")}
            className={`pb-2 border-b-2 transition-colors ${authMode === "signup" ? "border-foreground text-foreground" : "border-transparent text-muted-foreground"}`}
          >
            Register
          </button>
        </div>

        <form className="space-y-12" onSubmit={submitAuth}>
          <div className="space-y-8">
            <div className="group">
              <label className="block text-xs font-bold uppercase tracking-widest mb-2 text-muted-foreground group-focus-within:text-foreground transition-colors">
                Email Address
              </label>
              <input
                required
                type="email"
                value={authState.email}
                onChange={(e) =>
                  setAuthState((state) => ({ ...state, email: e.target.value }))
                }
                className="w-full bg-transparent border-b border-border py-4 text-2xl font-medium focus:border-foreground outline-none transition-colors placeholder:text-muted-foreground/50 text-foreground"
                placeholder="user@domain.com"
              />
            </div>

            <div className="group">
              <label className="block text-xs font-bold uppercase tracking-widest mb-2 text-muted-foreground group-focus-within:text-foreground transition-colors">
                Password
              </label>
              <input
                required
                type="password"
                value={authState.password}
                onChange={(e) =>
                  setAuthState((state) => ({
                    ...state,
                    password: e.target.value,
                  }))
                }
                className="w-full bg-transparent border-b border-border py-4 text-2xl font-medium focus:border-foreground outline-none transition-colors placeholder:text-muted-foreground/50 text-foreground"
                placeholder="password"
              />
            </div>
          </div>

          {authState.error && (
            <div className="text-destructive text-sm font-bold uppercase tracking-wide border-l-2 border-destructive pl-4">
              Error: {authState.error}
            </div>
          )}

          {authState.success && (
            <div className="text-green-600 text-sm font-bold uppercase tracking-wide border-l-2 border-green-600 pl-4">
              Success: {authState.success}
            </div>
          )}

          <button
            type="submit"
            disabled={authState.loading}
            className="group w-full bg-foreground text-background h-20 flex items-center justify-between px-8 hover:bg-destructive hover:text-destructive-foreground transition-colors disabled:opacity-50"
          >
            <span className="uppercase tracking-widest font-bold text-sm">
              {authState.loading
                ? "Processing..."
                : authMode === "login"
                  ? "Enter System"
                  : "Create Account"}
            </span>
            <ArrowRight className="w-6 h-6 group-hover:translate-x-2 transition-transform" />
          </button>
        </form>
      </div>
    </div>
  );
}

