import { useEffect, useState } from "react";
import { createFileRoute, Navigate } from "@tanstack/react-router";
import {
  useQuery,
  useSuspenseQuery,
  useQueryClient,
} from "@tanstack/react-query";
import { Command as CommandPrimitive } from "cmdk";
import { Loader2, X } from "lucide-react";

import {
  searchGames,
  type GameSearchResult,
  type GameLogEntry,
} from "@/server/games";
import { GameLogDialog } from "@/components/GameLogDialog";
import { PageHeader } from "@/components/page-header";
import {
  Command,
  CommandGroup,
  CommandItem,
  CommandList,
} from "@/components/ui/command";
import { cn } from "@/lib/utils";
import { logsQueryOptions } from "@/lib/queries";

export const Route = createFileRoute("/")({
  component: HomePage,
  loader: ({ context }) =>
    context.queryClient.ensureQueryData(logsQueryOptions),
  errorComponent: () => <Navigate to="/login" />,
});

function HomePage() {
  const queryClient = useQueryClient();

  const [query, setQuery] = useState("");
  const [debouncedQuery, setDebouncedQuery] = useState("");

  const [selectedGame, setSelectedGame] = useState<
    GameSearchResult | GameLogEntry | null
  >(null);
  const [isDialogOpen, setIsDialogOpen] = useState(false);

  // Debounce search input to avoid firing a query on every keystroke
  useEffect(() => {
    const trimmed = query.trim();
    const timer = setTimeout(() => setDebouncedQuery(trimmed), 300);
    return () => clearTimeout(timer);
  }, [query]);

  const canSearch = debouncedQuery.length >= 2;

  const logsQuery = useSuspenseQuery(logsQueryOptions);

  const searchQuery = useQuery({
    queryKey: ["searchGames", debouncedQuery],
    queryFn: ({ signal }) =>
      searchGames({ data: { query: debouncedQuery }, signal }),
    enabled: canSearch,
    staleTime: 1000 * 60 * 3,
  });

